  \"2013-03-15T21:18:38.026673\",\n\t\"name\": \"mean-annual-runoff-precipitation-and-evapotranspiration-in-the-glaciated-northeastern-u-1951-8033517\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Two maps, compiled at 1:1,000,000 scale,
  depict mean annual runoff, precipitation, and evapotranspiration in the part of
  the United States east of Cleveland, Ohio and north of the southern limit of glaciation.
  The maps are mutually consistent in that runoff equals precipitation minus evapotranspiration
  everywhere. The runoff map is based on records of streamflow from 503 watersheds
  in the United States and southernmost Canada, adjusted to represent 1951-80 and
  supplemented by records of precipitation at 459 stations. Precipitation at each
  station was partitioned into point estimates of runoff and evapotranspiration, which
  were constrained such that the evapotranspiration estimates varied smoothly across
  the region and decreased with increasing latitude and altitude, and the runoff estimates
  were consistent with measured runoff from nearby watersheds. A point estimate of
  runoff was allowed to equal mean runoff in a nearby watershed, or to be somewhat
  higher (or lower) if a compensating departure from mean watershed runoff could be
  inferred in distant parts of the watershed on the basis of altitude or regional
  trends. Then, precipitation contours were drawn to parallel runoff contours but
  differ from them by the magnitude of nearby estimates of evapotranspiration. These
  maps may slightly underrepresent mean precipitation and evapotranspiration in areas
  of high relief because most precipitation stations in such areas are in valleys.
  These 3 coverages were used to produce Open-File Report 96-395. Additional information
  about methodology can be found in this report\",\n\t\"license_title\": null,\n\t\"extras\":
